import React from "react";
import {
  AppBar, Toolbar, Typography, IconButton, Menu, MenuItem, Avatar,
  Box, Card, Divider, Button, Badge
} from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import WalletIcon from "@mui/icons-material/AccountBalanceWallet";
import StarIcon from "@mui/icons-material/Star";
import MenuIcon from "@mui/icons-material/Menu";
import MoreHorizIcon from "@mui/icons-material/MoreHoriz";

const navLinks = [
  { label: "Home" },
  { label: "Masters", menu: ["Master 1", "Master 2"] },
  { label: "Order", menu: ["Place an Order", "My Cart", "My Orders"] },
  { label: "Reports", menu: ["Report 1", "Report 2"] },
  { label: "Integration Services", menu: [] },
  { label: "Customer Services", menu: [] },
  { label: "Learning", menu: [] },
];

const metricCards = [
  {
    label: "Available Loyalty",
    value: "₹0",
    icon: <StarIcon sx={{ color: "#e23744", fontSize: 40 }} />,
    color: "#ffe3e6",
    sub: "Blocked (In Cart, Payment Initiated)"
  },
  {
    label: "My Wallet Limit",
    value: "₹0",
    icon: <WalletIcon sx={{ color: "#e23744", fontSize: 40 }} />,
    color: "#ffdcdc",
    status: "Active"
  },
];

export default function ZomatoDash() {
  // Dropdown menu state
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [menuIdx, setMenuIdx] = React.useState(null);
  const handleMenuOpen = (e, idx) => { setAnchorEl(e.currentTarget); setMenuIdx(idx); };
  const handleMenuClose = () => { setAnchorEl(null); setMenuIdx(null); };

  return (
    <Box sx={{ bgcolor: "#fff5f7", minHeight: "100vh", width: "100vw", overflow: "hidden" }}>
      {/* Top Navbar */}
      <AppBar position="static" sx={{ bgcolor: "#e23744", boxShadow: 0 }}>
        <Toolbar sx={{ minHeight: 64, px: 4 }}>
          {/* Logo */}
          <Typography variant="h6" fontWeight={900} sx={{ mr: 7, fontSize: 32, letterSpacing: 1 }}>
            Zomato
          </Typography>
          {/* Desktop Nav */}
          <Box sx={{ display: "flex", gap: 3 }}>
            {navLinks.map((item, idx) => (
              <Box key={item.label}>
                {item.menu && item.menu.length ? (
                  <>
                    <Button
                      sx={{ color: "#fff", fontWeight: 700, textTransform: "none", fontSize: 18 }}
                      onClick={e => handleMenuOpen(e, idx)}
                    >
                      {item.label}
                    </Button>
                    <Menu
                      anchorEl={anchorEl}
                      open={menuIdx === idx}
                      onClose={handleMenuClose}
                      MenuListProps={{ dense: true }}
                    >
                      {item.menu.map(sub => (
                        <MenuItem key={sub} onClick={handleMenuClose}>{sub}</MenuItem>
                      ))}
                    </Menu>
                  </>
                ) : (
                  <Button
                    sx={{ color: "#fff", fontWeight: 700, textTransform: "none", fontSize: 18 }}
                  >
                    {item.label}
                  </Button>
                )}
              </Box>
            ))}
          </Box>
          {/* Profile section */}
          <Box sx={{ flexGrow: 1 }} />
          <IconButton size="large" sx={{ mr: 1, color: "#fff" }}>
            <Badge badgeContent={0} color="error">
              <ShoppingCartIcon sx={{ fontSize: 28 }} />
            </Badge>
          </IconButton>
          <Typography sx={{ color: "#fff", fontWeight: 700, fontSize: 20, mr: 2 }}>
            Hello, User
          </Typography>
          <Avatar
            sx={{ width: 44, height: 44, bgcolor: "#fff", color: "#e23744", fontWeight: 900, fontSize: 19 }}
          >U</Avatar>
        </Toolbar>
      </AppBar>
      {/* Dashboard Metrics */}
      <Box sx={{
        display: "flex",
        gap: 3,
        px: 6,
        pt: 4,
        pb: 2,
        justifyContent: "flex-start"
      }}>
        {metricCards.map(card => (
          <Card key={card.label}
            sx={{
              p: 3, borderRadius: 3, minWidth: 285, boxShadow: 5, bgcolor: card.color,
              display: "flex", alignItems: "flex-start"
            }}
          >
            <Box sx={{ mr: 2 }}>{card.icon}</Box>
            <Box>
              <Typography fontWeight={700} sx={{ color: "#e23744", fontSize: 18 }}>
                {card.label}
              </Typography>
              <Typography variant="h5" fontWeight={900}> {card.value} </Typography>
              <Typography variant="body2" sx={{ opacity: .7 }}>
                {card.sub || ""}
              </Typography>
              {card.status && (
                <Typography variant="subtitle2" sx={{
                  mt: 1, bgcolor: "#e23744", color: "#fff", px: 2.5, py: .4,
                  borderRadius: 10, fontWeight: 900, display: "inline-block"
                }}>
                  Status {card.status}
                </Typography>
              )}
            </Box>
          </Card>
        ))}
        {/* Cart Status Card */}
        <Card sx={{
          p: 3, borderRadius: 3, minWidth: 285, boxShadow: 5, bgcolor: "#ffe8ec",
          display: "flex", alignItems: "flex-start"
        }}>
          <ShoppingCartIcon sx={{ color: "#e23744", fontSize: 40, mr: 2 }} />
          <Box>
            <Typography fontWeight={700} sx={{ color: "#e23744", fontSize: 18 }}>
              Cart Status
            </Typography>
            <Typography variant="h5" fontWeight={900}>Active</Typography>
          </Box>
        </Card>
      </Box>
      {/* Main Data Row (Orders/Assets) */}
      <Box sx={{
        mt: 3,
        px: 6,
        display: "flex",
        flexDirection: "row",
        gap: 3,
        width: "100%",
        justifyContent: "flex-start"
      }}>
        <Card sx={{
          flex: 2,
          minWidth: 400,
          p: 3.5,
          borderRadius: 3,
          boxShadow: 3,
          bgcolor: "#fff"
        }}>
          <Box sx={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
            <Typography variant="h6" fontWeight={900} sx={{ color: "#e23744" }}>
              My Last 5 Orders
            </Typography>
            <Button variant="text"
              sx={{
                background: "#ffe4ec", color: "#e23744",
                borderRadius: 13, fontWeight: 700, textTransform: "none",
                px: 3, py: .7
              }}>
              More
            </Button>
          </Box>
          <Divider sx={{ mt: 1.5, mb: 2 }} />
          <Typography sx={{ opacity: 0.7 }}>No records found</Typography>
        </Card>
        <Card sx={{
          flex: 1,
          minWidth: 320,
          p: 3.5,
          borderRadius: 3,
          boxShadow: 3,
          bgcolor: "#fff"
        }}>
          <Box sx={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
            <Typography variant="h6" fontWeight={900} sx={{ color: "#e23744" }}>
              My Assets
            </Typography>
            <Button variant="text"
              sx={{
                background: "#ffe4ec", color: "#e23744",
                borderRadius: 13, fontWeight: 700, textTransform: "none",
                px: 3, py: .7
              }}>
              More
            </Button>
          </Box>
          <Divider sx={{ mt: 1.5, mb: 2 }} />
          <Typography sx={{ opacity: 0.7 }}>No records found</Typography>
        </Card>
      </Box>
      {/* Footer */}
      <Box sx={{
        width: "100%",
        mt: 15,
        textAlign: "center",
        py: 2,
        bgcolor: "#fff5f7",
        color: "#e23744",
        fontWeight: 600
      }}>
        &copy; 2025 Zomato. All rights reserved. | Contact | Privacy Policy
      </Box>
      {/* No scrollbars anywhere */}
    </Box>
  );
}
